import React from 'react'

type TodoDatas = {
    content: string,
    isActive: boolean,
    isComplete: boolean,
}

function TodoItem(props: any) {
    return (
        <li>
            <div className={`circle-check ${props.element.isActive === true ? "circle-check-active" : ""}`} onClick={() => props.handleActive(props.index)}>
                {
                    props.element.isActive === true &&
                        <svg xmlns="http://www.w3.org/2000/svg" width="11" height="9"><path fill="none" stroke="#FFF" stroke-width="2" d="M1 4.304L3.696 7l6-6"/></svg>
                }
            </div>
        <p className={`${props.element.isComplete === true ? "todo-completed" : ""}`} onClick={() => props.handleComplete(props.index)}> {props.element.content} </p>
    </li>
    );
}

export default TodoItem;
